import unittest
import fit
import numpy
from pymongo import MongoClient

class test_DB(unittest.TestCase):

	def setUp(self):
		class Object(object):
			pass
		args = Object()
		args.verbose = False
		args.mongo_port = 27017
		args.db_name = 'TickTock'
		args.collection_name = 'rawdatamodels'
		args.template_collection = 'templatemodels'
		args.fetch_limit = 9
		args.show_plots = False
		self.db = fit.DB(args)

	def test_loadData(self):
		data = self.db.loadData()
		self.assertTrue(numpy.array_equal(data[0],dbData()),
			msg="OPTIONAL load data from database test failed")

	def test_saveTemplate(self):
		nTemplates = self.db.getNumTemplates()
		self.db.saveTemplate(numpy.zeros(3072),"TIMESTAMP")
		self.assertEquals(nTemplates+1, self.db.getNumTemplates(),
			msg="OPTIONAL save template test failed")

	def testLoadTemplate(self):
		template = self.db.loadTemplate()
		self.assertTrue(numpy.array_equal(template[0],dbTemplate()),
			msg="OPTIONAL load template test failed")
		

